(1, '[\"cpanel@q-mktops.com\"]', '[\"escortdemo@q-mktops.com\"]', '[]', '[]', '1704964864', '[q-mktops.com] Client configuration settings for escortdemo@q-mktops.com.', '<body style=\"background:#F4F4F4\">\r\n    <div style=\"margin:0;padding:0;background:#F4F4F4\">\r\n        <table cellpadding=\"10\" cellspacing=\"0\" border=\"0\" width=\"100%\" style=\"width:0 auto;\">\r\n            <tbody>\r\n                <tr>\r\n                    <td align=\"center\">\r\n                        <table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" width=\"680\" style=\"border:0;width:0 auto;max-width:680px;\">\r\n                            <tbody>\r\n                                <tr>\r\n                                                                        <td width=\"680\" height=\"25\" style=\"font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;font-size:16px;color:#333333\">\r\n                                                                                                                                Client Configuration settings for escortdemo@q-mktops.com.                                                                            </td>\r\n                                                                    </tr>\r\n                                <tr>\r\n                                                                        <td style=\"padding: 15px 0 20px 0; background-color: #FFFFFF; border: 2px solid #E8E8E8; border-bottom: 2px solid #FF6C2C;\">\r\n                                        <table width=\"680\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"background:#FFFFFF;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;\">\r\n                                            <tbody>\r\n                                                <tr>\r\n                                                    <td width=\"15\">\r\n                                                    </td>\r\n                                                    <td width=\"650\">\r\n                                                        <table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" width=\"100%\">\r\n                                                            <tbody>\r\n                                                                <tr>\r\n                                                                    <td>\r\n                                                                        <div id=\"manual_settings_area\" class=\"section\">\r\n        <h2 id=\"hdrManualSettings\">Mail Client Manual Settings</h2>\r\n        \r\n        <div class=\"row\">\r\n         <div class=\"col-md-6\">\r\n          <div id=\"ssl_settings_area\"\r\n            \r\n            style=\"background-color: #fff;  border: 1px solid transparent; border-radius: 4px; box-shadow: 0 1px 1px rgba(0, 0, 0, 0.05); margin-bottom: 20px; border-color: #428bca;\"\r\n            \r\n            class=\"preferred-selection panel panel-primary\">\r\n               <div\r\n                \r\n                style=\"border-top-left-radius: 3px; border-top-right-radius: 3px; padding: 10px 15px; background-color: #428bca; border-color: #428bca; color: #fff;\"\r\n                \r\n                class=\"panel-heading\">\r\n                Secure <abbr title=\"Secure Sockets Layer\">SSL</abbr>/<abbr title=\"Transport Layer Security\">TLS</abbr> Settings\r\n                (Recommended)\r\n              </div>\r\n              <table class=\"table manual_settings_table\" style=\"border-collapse: collapse; border-spacing: 0; margin-bottom: 0; width: 100%; background-color: transparent; max-width: 100%;\">\r\n                  <tr>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"lblSSLSettingsAreaUsername\">Username:</td>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"valSSLSettingsAreaUsername\" class=\"data wrap-text\">escortdemo@q-mktops.com</td>\r\n                  </tr>\r\n                  <tr>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"lblSettingsAreaPassword\">Password:</td>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"valSettingsAreaPassword\" class=\"escape-note\"> Use the email accounts password.</td>\r\n                  </tr>\r\n                  <tr>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"lblSettingsAreaIncomingServer\">Incoming Server:</td>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"valSettingsAreaIncomingServer\" class=\"data\">mail.q-mktops.com\r\n                          <ul\r\n                          style=\"margin-bottom: 10px; margin-top: 0; list-style: outside none none; margin-left: -5px; padding-left: 0;\"\r\n                          class=\"port_list list-inline\">\r\n                              <li style=\"display: inline-block; padding-left: 5px; padding-right: 5px;\"><abbr title=\"Internet Message Access Protocol\" class=\"initialism\">IMAP</abbr> Port: 993</li>\r\n                              \r\n                              <li style=\"display: inline-block; padding-left: 5px; padding-right: 5px;\"><abbr title=\"Post Office Protocol 3\" class=\"initialism\">POP3</abbr> Port: 995</li>\r\n                              \r\n                          </ul>\r\n                      </td>\r\n                  </tr>\r\n                  \r\n                  <tr>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"lblSettingsAreaOutgoingServer\">Outgoing Server:</td>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"valSettingsAreaOutGoingServer\" class=\"data\">mail.q-mktops.com\r\n                          <ul\r\n                          style=\"margin-bottom: 10px; margin-top: 0; list-style: outside none none; margin-left: -5px; padding-left: 0;\"\r\n                          class=\"port_list list-inline\">\r\n                              <li style=\"display: inline-block; padding-left: 5px; padding-right: 5px;\"><abbr title=\"Simple Mail Transfer Protocol\">SMTP</abbr> Port: 465</li>\r\n                          </ul>\r\n                      </td>\r\n                  </tr>\r\n                  \r\n                  <tr>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" colspan=\"2\" class=\"notes\">\r\n                                                    \r\n                                                                                <div id=\"lblSettingsAreaSmallNote1\" class=\"small_note\">IMAP, POP3, and SMTP require authentication.</div>\r\n                      </td>\r\n                  </tr>\r\n              </table>\r\n          </div>\r\n         </div>\r\n  \r\n      </div>\r\n        \r\n\r\n        <div class=\"row\" id=\"nonSSL\" style=\"display: none\">\r\n         <div class=\"col-md-6\">\r\n           <div id=\"non_ssl_settings_area\"\r\n            \r\n            style=\"background-color: #fff;  border: 1px solid transparent; border-radius: 4px; box-shadow: 0 1px 1px rgba(0, 0, 0, 0.05); margin-bottom: 20px; border-color: #f6c342;\"\r\n            \r\n           class=\"panel panel-default panel-warning\">\r\n               <div\r\n                \r\n                style=\"border-top-left-radius: 3px; border-top-right-radius: 3px; padding: 10px 15px; background-color: #fcf8e1; border-color: #f6c342; color: #333;\"\r\n                \r\n                class=\"panel-heading\">\r\n                <span id=\"descNonSSLSettings\" class=\"caption not-recommended\">Non-SSL Settings (NOT Recommended)</span>\r\n              </div>\r\n              <table id=\"tblManualSettingsTable\" class=\"table manual_settings_table\" style=\"border-collapse: collapse; border-spacing: 0; margin-bottom: 0; width: 100%; background-color: transparent; max-width: 100%;\">\r\n                  <tr>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"lblNonSSLSettingsUsername\">Username:</td>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"valNonSSLSettingsUsername\" class=\"data wrap-text\">escortdemo@q-mktops.com</td>\r\n                  </tr>\r\n                  <tr>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"lblNonSSLSettingsPassword\">Password:</td>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"valNonSSLSettingsPassword\" class=\"escape-note\">Use the email accounts password.</td>\r\n                  </tr>\r\n                  <tr>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"lblNonSSLSettingsIncomingServer\">Incoming Server:</td>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"valNonSSLSettingsIncomingServer\" class=\"data\">mail.q-mktops.com                          <ul\r\n                          style=\"margin-bottom: 10px; margin-top: 0; list-style: outside none none; margin-left: -5px; padding-left: 0;\"\r\n                          class=\"port_list list-inline\">\r\n                              <li style=\"display: inline-block; padding-left: 5px; padding-right: 5px;\"><abbr title=\"Internet Message Access Protocol\" class=\"initialism\">IMAP</abbr> Port: 143</li>\r\n                               \r\n                              <li style=\"display: inline-block; padding-left: 5px; padding-right: 5px;\"><abbr title=\"Post Office Protocol 3\" class=\"initialism\">POP3</abbr> Port: 110</li>\r\n                              \r\n                          </ul>\r\n                      </td>\r\n                  </tr>\r\n                   \r\n                  <tr>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"NonSSLSettingsOutgoingServer\">Outgoing Server:</td>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" id=\"NonSSLSettingsOutgoingServerData\" class=\"data\">mail.q-mktops.com                          <ul\r\n                          style=\"margin-bottom: 10px; margin-top: 0; list-style: outside none none; margin-left: -5px; padding-left: 0;\"\r\n                          class=\"port_list list-inline\">\r\n                              <li style=\"display: inline-block; padding-left: 5px; padding-right: 5px;\"><abbr title=\"Simple Mail Transfer Protocol\">SMTP</abbr> Port: 587</li>\r\n                          </ul>\r\n                      </td>\r\n                  </tr>\r\n                  \r\n                  <tr>\r\n                      <td style=\"border-top: 1px solid #ddd; padding: 8px;\" colspan=\"2\" class=\"notes\">\r\n                                                    \r\n                                                                                <div id=\"descNonSSLSettingsAuthenticationIsRequiredForIMAPPOP3SMTP1\" class=\"small_note\">IMAP, POP3, and SMTP require authentication.</div>\r\n                      </td>\r\n                  </tr>\r\n              </table>\r\n          </div>\r\n        </div>\r\n      </div>\r\n\r\n    </div><p>\r\n A .mobileconfig file for use with iOS for iPhone/iPad/iPod and MacOS Mail.app for Mountain Lion (10.8+) is attached to this message.\r\n</p>                                                                    </td>\r\n                                                                </tr>\r\n                                                                <tr>\r\n                                                                    <td>\r\n                                                                        <div style=\"font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;border-top: 2px solid #E8E8E8; padding-top:5px; margin-top: 5px; font-size:12px; color: #666666;\">\r\n        <p style=\"padding:0 0 0 0; margin: 5px 0 0 0;\">\r\n       